import React from "react";
import DeleteOutlineIcon from "@material-ui/icons/DeleteOutline";

const Note = (props) => {
  const deleteNote = () => {
    props.delete
  };
  return (
    <>
      <div className="note">
        <h1> {props.title}</h1>
        <br />
        <p> {props.content} </p>
        <button className="btn" onClick={deleteNote}>
          <DeleteOutlineIcon className="delete_Icon" />
        </button>
      </div>
    </>
  );
};

export default Note;
